  constructor(){
    super();
    this.state={
      String:'slm'
    };
  }
  render(){
    return(
      <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>{this.state.String
          }

        </p>
      <button onClick={()=> this.setState({string:'selemou alikom'})}>
        change text
      </button>
      </header>
    </div>

    )

  }
}

export default App;
